import { Box, Typography } from '@mui/material'
import React from 'react'

const Blogs = () => {
    //slider work

    var settings = {
        className: "slider variable-width",
        centerMode: false,
        dots: true,
        infinite: false,
        speed: 500,
        slidesToShow: 3,
        slidesToScroll: 3,
        initialSlide: 0,
        responsive: [
          {
            breakpoint: 1024,
            settings: {
              slidesToShow: 3,
              slidesToScroll: 3,
              infinite: true,
              dots: true
            }
          },
          {
            breakpoint: 600,
            settings: {
              slidesToShow: 2,
              slidesToScroll: 2,
              initialSlide: 2
            }
          },
          {
            breakpoint: 480,
            settings: {
              slidesToShow: 1,
              slidesToScroll: 1
            }
          }
        ]
      };
  return (
    <Box pt={3} mt={3} p={3}>
     <Typography variant='h5' component='div' fontWeight={600}>
        Blogs and Articles
         </Typography>
        <Typography variant='subtitle2' color='#747474'>
          Read what's happening in Real Estate
        </Typography>


    </Box>
  )
}

export default Blogs
